import { library } from '@fortawesome/fontawesome-svg-core'
import { faArrowRight, faBars, faHeart, faShoppingBag, faTimes, faSearch, faCaretDown, faCaretUp} from '@fortawesome/free-solid-svg-icons'

library.add( faArrowRight, faBars, faHeart, faShoppingBag, faTimes, faSearch, faCaretDown, faCaretUp );
